import React from 'react';
import Select from './field/select';

function Question3(props) {
  return (
    <div>
      <h1 className="question">Question 3</h1>
      <p>Select your life core values. In other words, select what you want to experience in your daily life, making them habits you believe will move you towards your Vision. (Select 5 values).</p>
      <Select /> <br />
      <Select /> <br />
      <Select /> <br />
      <Select /> <br />
      <Select /> <br />
    </div>
  );
}

export default Question3;
